import React, { Suspense, lazy } from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import ReactDOM from "react-dom/client";
import { Provider } from "react-redux";
import store from "./RootRedux/index";

import { Container } from "react-bootstrap";
import "./index.css";

import ScrollToTop from "./Common/ScrollToTop";
import Hamburg from "./Common/Hamburger";
import "bootstrap/dist/css/bootstrap.min.css";

const Login = lazy(() => import("./Views/Customer/Login"));
const UserHome = lazy(() => import("./Views/Customer/Home"));
const UserDashboard = lazy(() => import("./Views/Customer/Dashboard"));

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <Provider store={store}>
    <Router>
      <ScrollToTop />
      <Hamburg />
      <Suspense fallback={<div />}>
        <Container>
          <Routes>
            <Route path="/login" element={<Login />} />
            <Route path="/dash" element={<UserDashboard />} />
            <Route path="/" element={<UserHome />} />
          </Routes>
        </Container>
      </Suspense>
    </Router>
  </Provider>
);
